import Cards from './cards';

function ListCard(props) {
  const {search, targetRef} = props
  const [cards, setCards] = React.useState([]);

  React.useEffect(() => {
    // Внутри useEffect используйте fetch для загрузки данных с API
    fetch('https://64c970ddb2980cec85c23f10.mockapi.io/PizzaCard')
      .then((response) => response.json())
      .then((data) => setCards(data))
      .catch(
        (error) => console.error('Error fetching data:', error)
        );
  }, []);
  
  return (
    <div>
        <Cards cards={cards}  search={search} targetRef ={targetRef}/>
    </div>
  )
}

export default ListCard
